    {
        List<PropertyInfo> resultProps = new List<PropertyInfo>();
        Type modelType = Model.ModelMetadata.ModelType;
        PropertyInfo[] props = modelType.GetProperties();
        //Loop props
        foreach (PropertyInfo prop in props)
